<!DOCTYPE html>
<html lang="de">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>House of B'LANCE · Logo Vergleich</title>
    <link href="https://fonts.googleapis.com/css2?family=Montserrat:wght@300;400;500;600&display=swap" rel="stylesheet">
    <style>
        * { margin: 0; padding: 0; box-sizing: border-box; }

        :root {
            --blue: #7A93A1;
            --mint: #8FB8A8;
            --black: #111111;
            --white: #FFFFFF;
            --cream: #F5F3F0;
        }

        body {
            font-family: 'Montserrat', sans-serif;
            background: var(--cream);
            color: var(--black);
        }

        /* Navigation */
        .nav {
            position: fixed;
            top: 25px;
            left: 50%;
            transform: translateX(-50%);
            z-index: 1000;
            display: flex;
            gap: 8px;
            background: rgba(17,17,17,0.9);
            backdrop-filter: blur(20px);
            padding: 6px;
            border-radius: 50px;
        }

        .nav-btn {
            padding: 10px 24px;
            border: none;
            border-radius: 50px;
            font-family: 'Montserrat', sans-serif;
            font-size: 13px;
            font-weight: 500;
            cursor: pointer;
            transition: all 0.3s ease;
            background: transparent;
            color: var(--white);
            text-decoration: none;
        }

        .nav-btn:hover { background: rgba(255,255,255,0.1); }
        .nav-btn.active { background: var(--blue); }

        /* Section */
        .section {
            padding: 100px 40px 60px;
        }

        .section-title {
            text-align: center;
            font-size: 48px;
            font-weight: 300;
            letter-spacing: 12px;
            text-transform: uppercase;
            margin-bottom: 50px;
        }

        /* Color Headers */
        .color-headers {
            display: grid;
            grid-template-columns: 1fr 1fr;
            gap: 20px;
            max-width: 900px;
            margin: 0 auto 30px;
        }

        .color-header {
            text-align: center;
            font-size: 12px;
            letter-spacing: 3px;
            text-transform: uppercase;
            padding: 12px;
            border-radius: 8px;
            font-weight: 500;
        }

        .color-header.blue { background: var(--blue); color: white; }
        .color-header.mint { background: var(--mint); color: var(--black); }

        /* Comparison Row */
        .compare-row {
            display: grid;
            grid-template-columns: 1fr 1fr;
            gap: 20px;
            max-width: 900px;
            margin: 0 auto 20px;
        }

        .compare-card {
            background: var(--white);
            border-radius: 16px;
            padding: 30px;
            display: flex;
            align-items: center;
            justify-content: center;
            aspect-ratio: 1;
            transition: all 0.3s ease;
            box-shadow: 0 4px 20px rgba(0,0,0,0.06);
        }

        .compare-card:hover {
            transform: translateY(-3px);
            box-shadow: 0 12px 30px rgba(0,0,0,0.1);
        }

        .compare-card.dark-bg {
            background: var(--black);
        }

        .compare-card img {
            max-width: 90%;
            max-height: 90%;
            object-fit: contain;
        }

        /* Divider */
        .divider {
            height: 2px;
            background: linear-gradient(90deg, transparent, var(--blue), transparent);
            max-width: 400px;
            margin: 80px auto;
        }

        /* Responsive */
        @media (max-width: 768px) {
            .compare-row, .color-headers { gap: 10px; }
            .section { padding: 80px 15px 40px; }
            .section-title { font-size: 32px; letter-spacing: 6px; }
            .compare-card { padding: 15px; border-radius: 12px; }
        }
    </style>
</head>
